	module.exports = "<div class=\"row\">\n\t<div class=\"col-md-8 col-md-offset-2 col-sm-10 col-sm-offset-1 page-header\">\n\t\t<h3>About Simplechart</h3>\n\t</div>\n\t<div class=\"col-md-8 col-md-offset-2 col-sm-10 col-sm-offset-1\">\n\t\t<p>Simplechart lets anyone quickly create interactive data visualizations that are easy to embed in any webpage.</p>\n\n\t\t<p>Today’s digital newsrooms face tight demands and unique challenges. With Simplechart, newsrooms can build charts easily from scratch or quickly copy a data set from Excel and modify it to fit intricate stories. Editorial staff are able to focus on reporting instead of spending hours finding developers or designers to produce data visualizations, charts and graphs for news sites. Designers and developers are able to focus on larger projects instead of one-off visualizations.</p>\n\n\t\t<p>Simplechart outputs responsive charts, based on <a href=\"http://d3js.org\" target=\"_blank\">D3.js</a>, with a host of configurable options, interactive features, and shareable static images. It is, however, alpha software. So please check back as we continue to add features and make improvements.</p>\n\n\t\t<p>Simplechart is a project of <a href=\"http://alleyinteractive.com\" target=\"_blank\">Alley Interactive</a>, a full-service digital agency focused on news media and other high-volume publishers including <em>The New Republic</em>, CNN, <em>Time</em>, the Kaiser Family Foundation, the <em>New York Post</em>, <em>Foreign Policy</em>, and The Center for Investigative Reporting.</p>\n\t</div>\n</div>\n";

